import React, { Component } from 'react'

export default class CadastroUsuario extends Component {
  render() {
    return (
      <div> <input
      value={this.state.nomeCadastro}
      onChange={this.novoNomeCadastro}
    />
    <button onClick={this.cadastrarUsuario}>Enviar</button>
    {this.state.erro ? (
      <p>{this.state.erro}</p>
    ) : (
      this.state.cadastrado.map((cadastrado) => {
        return <listaCadastrados key={cadastrado.id} cadastrado={cadastrado} />;
      })
    )}</div>
    )
  }
}
